import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 59.1-506.16 Termination; survival of obligations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-506.16.md","filePath":"vacode/59.1-506.16.md"}'),i={name:"vacode/59.1-506.16.md"},r=a('<h1 id="§-59-1-506-16-termination-survival-of-obligations" tabindex="-1">§ 59.1-506.16 Termination; survival of obligations. <a class="header-anchor" href="#§-59-1-506-16-termination-survival-of-obligations" aria-label="Permalink to &quot;§ 59.1-506.16 Termination; survival of obligations.&quot;">​</a></h1><p>(a) Except as otherwise provided in subsection (b), on termination all obligations that are still executory on both sides are discharged.</p><p>(b) The following survive termination:</p><p>(1) a right based on previous breach or performance of the contract;</p><p>(2) an obligation of confidentiality, nondisclosure, or noncompetition to the extent enforceable under other law;</p><p>(3) a contractual use term applicable to any licensed copy or information received from the other party, or copies made of it, which are not returned or returnable to the other party;</p><p>(4) an obligation to deliver, or dispose of information, materials, documentation, copies, records, or the like to the other party, an obligation to destroy copies, or a right to obtain information from an escrow agent;</p><p>(5) a choice of law or forum;</p><p>(6) an obligation to arbitrate or otherwise resolve disputes by alternative dispute resolution procedures;</p><p>(7) a term limiting the time for commencing an action or for giving notice;</p><p>(8) an indemnity term or a right related to a claim of a type described in § <a href="http://law.lis.virginia.gov/vacode/59.1-508.5/" target="_blank" rel="noreferrer">59.1-508.5</a> (d) (1);</p><p>(9) a limitation of remedy or modification or disclaimer of warranty;</p><p>(10) an obligation to provide an accounting and make any payment due under the accounting; and</p><p>(11) any term that the agreement provides will survive.</p><p>2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0101" target="_blank" rel="noreferrer">101</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0996" target="_blank" rel="noreferrer">996</a>.</p>',15),n=[r];function l(s,c,p,d,m,h){return o(),t("div",null,n)}const u=e(i,[["render",l]]);export{g as __pageData,u as default};
